import React from 'react';
import ReactDOM from 'react-dom/client';
import './App.css';
import Nav from './nav';
import { BrowserRouter as Router , Switch , Route } from 'react-router-dom';
import Home from "./home";
import About from "./about";
function App(){
  return (
    <Router>
      <div>
        <Switch>
          <Route path="/" component={Home} />
          <Nav />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
